sourcesContent:
import styled from 'styled-components';

export const MusicStyled = styled.div`
	height: calc(100vh - 240px);
	width: 100vw;
	margin: 120px 0px 120px 0px;

	display: grid;
	grid-template-columns: 1fr 4fr;
	grid-gap: 0;
	align-items: center;

	h1 {
		margin-bottom: 200px;
	}
`;
